import React, { useState } from "react";
import Workout from "./Components/Cards";
import NavBar from "./Components/NavBar";
import WorkoutPlan from "./Components/WorkoutPlans";
import "./Desktop.css";

export interface Exercise {
  name: string;
  reps: number;
  sets: number;
}

export interface WorkoutData {
  id: number;
  title: string;
  description: string;
  image: string;
  onClickPlan: () => void;
  exercises: Exercise[];
}



const Desktop: React.FC = () => {
  const [showWorkoutPlan, setShowWorkoutPlan] = useState(false);

  const workoutData: WorkoutData[] = [
    {
      id: 1,
      title: 'Workout 1',
      description: 'This is workout 1 consisting of Workouts',
      image: './images/Workout1.jpg',
      onClickPlan: () => setShowWorkoutPlan(true),
      exercises: [
        { name: 'Exercise 1', reps: 10, sets: 3 },
        { name: 'Exercise 2', reps: 12, sets: 4 },
        // Add more exercises as needed
      ],
    },
    {
      id: 2,
      title: 'Workout 2',
      description: 'This is workout 2 consisting of Workouts',
      image: './images/Workout2.jpg',
      onClickPlan: () => setShowWorkoutPlan(true),
      exercises: [
        { name: 'Exercise 1', reps: 8, sets: 3 },
        { name: 'Exercise 2', reps: 10, sets: 4 },
        // Add more exercises as needed
      ],
    },
    // Add more workout data as needed
  ];


  const navigateBackToDesktop = () => {
    setShowWorkoutPlan(false);
  };

  return (
    <div>
      <NavBar onNavigateBack={navigateBackToDesktop} />
        <div style={{ display: 'flex', justifyContent: 'center', padding: '20px', flexWrap: 'wrap' }}>
          {workoutData.map((workout) => (
            <Workout key={workout.id} {...workout} />
          ))}
        </div>
    </div>
  );
};

export default Desktop;
